// import logo from './logo.svg';
import './App.css';
import { Container } from 'react-bootstrap';
import NavBar from './components/navbar/Navbar';

import { BrowserRouter} from "react-router-dom";
import {useEffect, useState } from 'react';
import UserProvider from './context/user';



function App() {
  const [fetching, setfetching] = useState(false);

  const [data, setdata] = useState([])


    const load = async () => {
      setfetching(true);
      await fetch('http://localhost:8000/api/all/?format=json')
        .then(res => res.json()).then(res => {
          setdata(res)
          // console.log(res)
        })
        .catch(err => {
          console.log(err);
      })
      setfetching(false);
    }

  useEffect(() => {

    load();
  },[])


  return (
    <UserProvider>
      <BrowserRouter>
        <div className="App">
            <NavBar />
            <Container>
            <div>
              {!fetching && data.map((item, i) => {
                console.log(item.id);
                return (<p key="{item.id}">{item.name}</p>)
              })
              }
              </div>
            </Container>
          </div>
        </BrowserRouter>
      </UserProvider>
  );
}

export default App;
